import React, { Component } from 'react'
import { Route, Redirect } from 'react-router-dom'
import { isAuth } from '../auth/helpers'

function Private({ component: Component, ...rest }) {
    return (
      <Route
        {...rest}
        render={props =>
          fakeAuth.isAuthenticated ? (
            <Component {...props} />
          ) : (
            <Redirect
              to={{
                pathname: "/login",
                state: { from: props.location }
              }}
            />
          )
        }
      />
    );
  }
